import React, {Component} from 'react';

  class AndMe extends Component {
    render(){
      return(
        <div className="AndMe">
           <div class="row">
           <div class="column"><p>Programming & Me.</p></div>
           <div class="column"><p>Sport & Me.</p></div>
           <div class="column"><p>Music & Me.</p></div>
           </div>
        </div>
      );
    }
  }

export default AndMe;
